import * as React from "react";
import { Routes, Route, Link, Switch } from "react-router-dom";
import "./App.css";
import { Home, About } from "./screens"

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/home" element={<Home />} />
        <Route path="/about" element={<About />} />
      </Switch>
      <nav>
        <Link to="/about">About</Link>
      </nav>
    </div>
  );
}

export default App;
